import React from 'react';
import ListItem from './ListItem.js';

class List extends React.Component {    
    render() {
        return (
            <ul>
                {this.props.todos.map(todo =>
                    <ListItem key={todo.id.toString()} onPress={this.props.onPress(1)}>{todo.text}</ListItem>
                )}
            </ul>
        )

    }
}

export default List;
